import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const data = [];

  for (let i = 0; i < props.variables.hourly.length; i++) {
    const dataPoint = props.variables.hourly.time.map((x, index) => ({
      x,
      y: props.variables.hourly[i][index],
    }));
    data.push(dataPoint);
  }

  const lines = Object.keys(props.variables.hourly)
    .filter((variableName) => variableName !== "time")
    .map((variableName) => (
      <Line
        key={variableName}
        type="monotone"
        dataKey={variableName}
        stroke="#8884d8"
      />
    ));

  console.log(data);
  return (
    <div
      style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}
    >
      <LineChart width={1000} height={500} data={data}>
        <XAxis dataKey="x" />
        <YAxis dataKey="y" />
        <CartesianGrid stroke="#ccc" />
        {lines}
        <Tooltip />
        <Legend />
      </LineChart>
    </div>
  );
};

export default VariablesGraph;
